import "testing"

func TestGetImgSimilarity(t *testing.T) {
	t.Log(GetImgSimilarity(png1Base64, png2Base64))
	t.Log(GetImgSimilarity(png1Base64, png3Base64))
}

func TestDifferentSizeImages(t *testing.T) {
	// 测试不同尺寸图片的相似度计算
	// 这些base64图片具有不同的尺寸
	similarity := GetImgSimilarity(png1Base64, png2Base64)
	t.Logf("不同尺寸图片的相似度: %f", similarity)

	// 验证相似度不为0（之前会因为尺寸不同直接返回0）
	if similarity == 0.0 {
		t.Error("不同尺寸图片的相似度不应该为0")
	}
}

